<script>
    let nouvellesAnnonces = document.getElementById("new");
    nouvellesAnnonces.style.display = 'none';
    var xhr = new XMLHttpRequest();
    xhr.open('GET', 'BDD.php?function=cat',true);
    var Cat = function()
    {
      if (xhr.readyState === 4 && xhr.status === 200)
        {
        let cat = xhr.response.split('|');
        let div = document.getElementById('cat');
        for(let i = 0; i<cat.length; i++){
          let option = document.createElement('option');
          option.value = cat[i];
          option.innerText = cat[i];
          div.appendChild(option);
        }
      }
    }
    xhr.addEventListener("readystatechange", Cat, false);
    xhr.send(null);

    var xhr2 = new XMLHttpRequest();
    xhr2.open('GET', 'BDD.php?function=new',true);
    var New = function()
    {
      if (xhr2.readyState === 4 && xhr2.status === 200)
      {
        console.log(xhr2);
        let tab = (xhr2.response.split('/separation/'));

        let img,ins,marque,utilisateur, desc,uti;
        for(let i = 0; i<tab.length-1; i++){
          img = tab[i].split('|')[6];
          ins = tab[i].split('|')[4];
          marque = tab[i].split('|')[0];
          utilisateur = tab[i].split('|')[1] + ' ' +  tab[i].split('|')[2];
          desc = tab[i].split('|')[5];
          uti = tab[i].split('|')[7];
          let int = i+1;
          let div = document.getElementById(int.toString());
          div.onclick = function() {
            window.location.href='../ficheinstrument/presentationinstrument.php?'+tab[i].split('|')[8];
          }
          div.childNodes[1].childNodes[1].src = uti;
          div.childNodes[1].childNodes[3].innerText = utilisateur;
          div.childNodes[3].childNodes[1].src = img;
          console.log(div.childNodes);

          div.childNodes[5].childNodes[1].innerText = ins;
          div.childNodes[5].childNodes[3].innerText = marque;

          div.childNodes[9].innerText = desc;
        }
        nouvellesAnnonces.style.display = 'flex';
      }
    }
    xhr2.addEventListener("readystatechange", New, false);
    xhr2.send(null);
</script>
